import React from 'react'
import Head from 'next/head'

const Home: React.FC = () => {
  return (
    <div >
      <Head>
        <title>PrimeNext - NextJS</title>
      </Head>

      <h1 style={{ color: "#e6e6e6", textAlign: "center" }}>Range IP - Primefox</h1>
      <input type="text" style={{ width: "400px", padding: "10px", placeContent: "rwarw" }} />
    </div>
  )
}

export default Home;
